import React from 'react';
import logo from './logo.svg';
import './App.css';
import ContentLoader from "react-content-loader"
function App() {
  return (
    <ContentLoader
    height={560}
    width={408}
    speed={2}
    primaryColor="#f3f3f3"
    secondaryColor="#ecebeb"
  >
    <rect x="257" y="298" rx="0" ry="0" width="259" height="167" />
    <rect x="429" y="296" rx="0" ry="0" width="202" height="56" />
    <rect x="288" y="108" rx="0" ry="0" width="0" height="0" />
    <rect x="16" y="140" rx="0" ry="0" width="394" height="312" />
    <rect x="347" y="152" rx="0" ry="0" width="0" height="0" />
  </ContentLoader>
  );
}

export default App;
